import './App.css';
import Navbar from './Navbar';
import Home from './home';

function App() {
  const title = 'Welcome to the new blog';
  const likes = 50;
  const person = { name: 'yoshi', age: 30 };
  const link = 'https://google.com'

  return (
    <div className="App">
      <Navbar/>
      <div className="content">
        <h1>{ title }</h1>
        <Home/>
        <p>Liked { likes } times</p>
        {/* <p>{ person }</p> */}
        <a href={ link }>
          google
        </a>
      </div>
    </div>
  );
}

export default App;
